      coachSmallCourseOptions: scsc.coachSmallCourseOptions$,
      authTabs: this.scheduleService.authTabs$
    };
  },
  data: function data() {
    return {};
  },
  computed: {
    routeName: function routeName() {
      return this.$route.name;
    }
  },
